import Navbar from './Navbar';

const Layout = (props) => (
   
    <div>
         <Head>
            <link href="/bootstrap/dist/css/bootstrap.min.css" />
        </Head>

        <Navbar />
        {
            props.children
        }
    </div>
)
export default Layout
